import styled from "@emotion/styled";
export const MainContainer = styled.div`
  width: 100%;
  height: 100%;
  padding-top: 10rem;
  text-align: center;
`;
export const MainFont = styled.div`
  font-family: Pretendard;
  font-weight: bold;
  color: white;
  width: 100vw;
  font-size: 8vw;
`;

export const MainFontContainer = styled.div`
  width: 100vw;
  padding-bottom: 10vh;
`;

export const Background = styled.div`
  width: 100%;
  background-color: rgba(98, 129, 224);
`;

export const LineLogo = styled.img`
  width: 100%;
  padding-top: 10rem;
`;

export const description = styled.div`
  font-size: 1.2rem;
  font-weight: 0.5rem;
  color: white;
  padding-top: 1rem;
`;

export const text1 = styled.div`
  margin-top: 1rem;
  margin-bottom: 1rem;
`;

//box

export const Box = styled.div`
  width: 100%;
  margin-top: 4rem;
`;

//left
export const leftBoxContainer = styled.div`
  width: 100%;
  padding-bottom: 6rem;
  @media screen and (max-width: 50rem) {
    padding-bottom: 1rem;
  }
`;
export const leftBox = styled.div`
  width: 65%;
  padding-top: 6rem;
  @media screen and (max-width: 100rem) {
    width: 75%;
  }
  @media screen and (max-width: 50rem) {
    padding-top: 1rem;
  }
  border-radius: 0rem 20rem 20rem 0rem;
  background-color: rgba(176, 192, 239);
`;

export const leftBoxTitle = styled.div`
  font-size: 6vw;
  font-weight: 500;
  text-align: left;
  margin-left: 4rem;
`;

export const leftBoxText = styled.div`
  text-align: left;
  padding-top: 1vh;
  margin-left: 4rem;
  font-size: 2vw;
`;

//right

export const rightPosition = styled.div`
  width: 100%;
`;

export const rightBoxContainer = styled.div`
  width: 100%;
  padding-bottom: 6rem;
  @media screen and (max-width: 50rem) {
    padding-bottom: 1rem;
  }
`;
export const rightBox = styled.div`
  width: 65%;
  padding-top: 6rem;
  position: relative;
  float: right;
  @media screen and (max-width: 100rem) {
    width: 75%;
  }
  @media screen and (max-width: 50rem) {
    padding-top: 1rem;
  }
  border-radius: 20rem 0rem 0rem 20rem;
  background-color: rgba(79, 103, 179);
`;

export const rightBoxTitle = styled.div`
  color: #fff;
  font-size: 6vw;
  font-weight: 500;
  text-align: right;
  margin-right: 4rem;
`;

export const rightBoxText = styled.div`
  color: #fff;
  text-align: right;
  padding-top: 1vh;
  font-size: 2vw;
  margin-right: 4rem;
`;
